import React, { useState, useEffect } from 'react';

function MapIframe(props) {
  const [iframeSrc, setIframeSrc] = useState('');

  useEffect(() => {
    const fetchIframeSrc = async () => {
      const url = new URL(props);
      const params = new URLSearchParams(url.search);
      const query = {
        q: params.get('q') || '',
        center: params.get('center') || '',
        zoom: params.get('zoom') || '15',
        output: params.get('output') || 'embed',
      };
      const iframeUrl = `https://www.google.com/maps/embed?${new URLSearchParams(query)}`;
      setIframeSrc(iframeUrl);
    };

    fetchIframeSrc();
  }, [props]);

  return <iframe src={iframeSrc} width="100%" height="450" frameBorder="0" allowFullScreen />;
}

export default MapIframe;
